import React, { Component } from "react";

class Login extends Component {
  render() {
    return(
      <form onSubmit={console.log}>
      <label>
        Name:
        <input type="text" />
      </label>
      <label>
        Password:
        <input type="password" />
      </label>
      <input type="submit" value="Submit" />
    </form>
    )
  }
}

export default Login;
